import React from 'react'


class App extends React.Component{

  constructor(props) {
    super(props);

    this.state = {
        color1: 'rojo',
        color2: 'amarillo',
        color3: 'dever',
    }
}


  br(){
    this.setState({
      color1: 'red',
      color2: 'amarillo',
      color3: 'dever',
    })
  }

  ba(){
    this.setState({
    color1: 'rojo',
    color2: 'yellow',
    color3: 'dever',
  })
}

  bv(){ 
    document.write()
    this.setState({
    color1: 'rojo',
    color2: 'amarillo',
    color3: 'green',
  })
}

  render(){
    return(
      <>
        <div className="semaforo" >

          <button className='rojo' onClick={() => {
                            this.br()
                        }}/>

          <button className="amarillo"onClick={() => {
                            this.ba()
                        }}/>

          <button className="dever"onClick={() => {
                            this.bv()
                        }}/>

        </div>

      </>
    )
  }
}

export default App;
